const parallaxStyle = {
  parallax: {
    height: "100vh",
    maxHeight: "500px",
    maxWidth: "700px",
    overflow: "hidden",
    position: "relative",

    backgroundSize: "cover",
    margin: "110",

    border: "100",
    display: "flex",
    alignItems: "center"
  },
  filter: {
    "&:before": {
      background: "rgba(0, 0, 0, 0.5)"
    },
    "&:after,&:before": {
      position: "absolute",
      zIndex: "1",
      width: "100%",
      height: "100%",
      display: "block",
      left: "0",
      top: "0",
      content: "''"
    }
  },
  small: {
    height: "380px"
  }
};

export default parallaxStyle;
